void L1_data_Uplane::thread_ap_NS_fsm() {
    switch (ap_CS_fsm.read().to_uint64()) {
        case 1 : 
            if ((esl_seteq<1,1,1>(ap_block_pp0_stage0_subdone.read(), ap_const_boolean_0) && esl_seteq<1,1,1>(ap_reset_idle_pp0.read(), ap_const_logic_0))) {
                ap_NS_fsm = ap_ST_fsm_pp0_stage1;
            } else if ((esl_seteq<1,1,1>(ap_block_pp0_stage0_subdone.read(), ap_const_boolean_0) && esl_seteq<1,1,1>(ap_const_logic_1, ap_reset_idle_pp0.read()))) {
                ap_NS_fsm = ap_ST_fsm_pp0_stage0;
            } else {
                ap_NS_fsm = ap_ST_fsm_pp0_stage0;
            }
            break;
        case 2 : 
            if (esl_seteq<1,1,1>(ap_block_pp0_stage1_subdone.read(), ap_const_boolean_0)) {
                ap_NS_fsm = ap_ST_fsm_pp0_stage2;
            } else {
                ap_NS_fsm = ap_ST_fsm_pp0_stage1;
            }
            break;
        case 4 : 
            if (esl_seteq<1,1,1>(ap_block_pp0_stage2_subdone.read(), ap_const_boolean_0)) {
                ap_NS_fsm = ap_ST_fsm_pp0_stage0;
            } else {
                ap_NS_fsm = ap_ST_fsm_pp0_stage2;
            }
            break;
        default : 
            ap_NS_fsm =  (sc_lv<3>) ("XXX");
            break;
    }
}

void L1_data_Uplane::thread_hdltv_gen() {
    const char* dump_tv = std::getenv("AP_WRITE_TV");
    if (!(dump_tv && string(dump_tv) == "on")) return;

    wait();

    mHdltvinHandle << "[ " << endl;
    mHdltvoutHandle << "[ " << endl;
    int ap_cycleNo = 0;
    while (1) {
        wait();
        const char* mComma = ap_cycleNo == 0 ? " " : ", " ;
        mHdltvinHandle << mComma << "{"  <<  " \"ap_rst_n\" :  \"" << ap_rst_n.read() << "\" ";
        mHdltvoutHandle << mComma << "{"  <<  " \"app_out_V_V_TDATA\" :  \"" << app_out_V_V_TDATA.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"app_out_V_V_TVALID\" :  \"" << app_out_V_V_TVALID.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"app_out_V_V_TREADY\" :  \"" << app_out_V_V_TREADY.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"sec_out_V_V_TDATA\" :  \"" << sec_out_V_V_TDATA.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"sec_out_V_V_TVALID\" :  \"" << sec_out_V_V_TVALID.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"sec_out_V_V_TREADY\" :  \"" << sec_out_V_V_TREADY.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"L1_state_out\" :  \"" << L1_state_out.read() << "\" ";
        mHdltvinHandle << "}" << std::endl;
        mHdltvoutHandle << "}" << std::endl;
        ap_cycleNo++;
    }
}

